import React from 'react';
import s from "./Immovables.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories";
import Adverts from "../../Adverts/Adverts";

import archirect from './../architect.svg';
import room from './../room.svg';
import auto from './../auto.svg';
import household from './../household.svg';

import {
  MAIN_PAGE,
  TRANSPORT, IMMOVABLES, HOUSEHOLD,
  APPARTAMENTS, HOUSES,
  CARS, MOTO,
  APPLIANCE, FURNITURE, setLocationName
} from "./UrlReducer";

const Immovables = () => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Subcategories nameSubCat={APPARTAMENTS.name} imgPath={room} urlCategory={IMMOVABLES.url} urlSubcategory={APPARTAMENTS.url}/>
            <Subcategories nameSubCat={HOUSES.name} imgPath={archirect} urlCategory={IMMOVABLES.url} urlSubcategory={HOUSES.url}/>
            <Category nameCategory={'Транспорт'} imgPath={auto} urlCategory={'transport'}/>
            <Category nameCategory={'Все для дома'} imgPath={household} urlCategory={'all_for_home'}/>
          </div>
        </div>
      </div>
  );
};

export default Immovables;
